import mainpage from "./modules/mainpage/ru";
import personalaccount from "./modules/personalaccount/ru";
import banktransfers from "./modules/banktransfers/ru";
import personalbankcards from "./modules/personalbankcards/ru";
import merchantaccount from "./modules/merchantaccount/ru";
import internetacquiring from "./modules/internetacquiring/ru";
import cardsemission from "./modules/cardsemission/ru";
import paymentprocessing from "./modules/paymentprocessing/ru";
import paymentsterminal from "./modules/paymentsterminal/ru";
import pos from "./modules/pos/ru";
import stock from "./modules/stock/ru";
import partnerprograms from "./modules/partnerprograms/ru";
import donations from "./modules/donations/ru";
import pricing from "./modules/pricing/ru";

const ru = {
  translations: {
    mainpage,
    personalaccount,
    banktransfers,
    personalbankcards,
    merchantaccount,
    internetacquiring,
    cardsemission,
    paymentprocessing,
    paymentsterminal,
    pos,
    stock,
    partnerprograms,
    donations,
    pricing
  },
};

export default ru;
